import React from 'react';
import {useAuth } from '../providers/auth';

// import { Container } from './styles';

function Profile() {
    const {user} = useAuth();
  return(
      <>
      <hr/>
      <h3>Profile</h3>
      <hr/>
      <h1>{user.name}</h1>
      </>
  )
}

export default Profile;
